INSERT INTO `mac_vod` VALUES (506,3,0,0,'城事特搜','','chengshitesou',1,'C','','','综艺','tu.php?tu=cj.subo8988.com:8988/upload/vod/2019-01-04/201901041546616274.jpg','','','','南方卫视','','','&nbsp;《城事特搜》是广东南方卫视（TVS2）一档融生活资讯文化传播与社会热点问题透视于一体的新型电视节目，创意独特、策划新颖、手法幽默2002年6月17日推出以来收视率和市场占有率一直位居本土同','更新至20190408期','',0,'0','','','大陆','国语','2019','','','','','','','',1,0,0,0,0,0,0,849,1,1,1,'',544,423,5.0,3380,676,1554906834,1554822137,1554822194,0,0,0,0.0,'','','','','','','','','','&nbsp;《城事特搜》是广东南方卫视（TVS2）一档融生活资讯文化传播与社会热点问题透视于一体的新型电视节目，创意独特、策划新颖、手法幽默2002年6月17日推出以来收视率和市场占有率一直位居本土同类节目的榜首。为进一步将其打造为本土最强的品牌栏目。2006年5月8日起《城事特搜》正式扩版，每期节目由25分钟延长至45分钟。将在节目内容得到进一步丰富的同时，务求做到以公众话题引起关注、以新奇趣怪吸引眼球、以多彩信息留住观众。','subom3u8$$$suboyun','no$$$no','$$$','20190103期$https://www.hongxinhuaxue.com/20190104/ATGEbYsv/index.m3u8#20190107期$https://www.hongxinhuaxue.com/20190108/kd6JkIqM/index.m3u8#20190108期$https://www.hongxinhuaxue.com/20190109/ZpFrTy7c/index.m3u8#20190109期$https://www.hongxinhuaxue.com/20190110/FHxoNXET/index.m3u8#20190110期$https://www.hongxinhuaxue.com/20190112/1IgPUKAS/index.m3u8#20190111期$https://www.48iuz.com/20190115/mZfaJFur/index.m3u8#20190115期$https://www.hongxinhuaxue.com/20190116/tVw3YiFw/index.m3u8#20190116期$https://www.hongxinhuaxue.com/20190117/ZjHQDdA8/index.m3u8#20190117期$https://www.48iuz.com/20190118/E0x6YwYM/index.m3u8#20190118期$https://www.hongxinhuaxue.com/20190122/HNgrWgdE/index.m3u8#20190122期$https://www.hongxinhuaxue.com/20190124/HxVZAr2M/index.m3u8#20190123期$https://www.48iuz.com/20190125/HHXhDlwL/index.m3u8#20190124期$https://www.hongxinhuaxue.com/20190126/MXPZwmsn/index.m3u8#20190125期$https://www.48iuz.com/20190128/AvIoPu78/index.m3u8#20190128期$https://www.hongxinhuaxue.com/20190131/geekeDDI/index.m3u8#20190129期$https://www.hongxinhuaxue.com/20190131/2GoCjO3h/index.m3u8#20190130期$https://www.48iuz.com/20190201/1LcXpYog/index.m3u8#20190131期$https://www.hongxinhuaxue.com/20190201/vjQJD1z6/index.m3u8#20190201期$https://www.hongxinhuaxue.com/20190202/mjLmgKCN/index.m3u8#2