niverse /DC宇宙」过去预定了13集的新剧《末日巡逻队 Doom Patrol》，该剧由Greg Berlanti负责﹑Jeremy Carver执笔剧本，剧中讲述','更新至08集','',0,'0','','','美国','英语','2019','','','','','','','',1,0,0,0,0,0,0,937,418,397,864,'',371,129,2.0,1542,771,1554946153,1554824171,0,0,0,0,0.0,'','','','','','','','','','DC品牌的线上频道「DC Universe /DC宇宙」过去预定了13集的新剧《末日巡逻队 Doom Patrol》，该剧由Greg Berlanti负责﹑Jeremy Carver执笔剧本，剧中讲述一群被世人遗弃的超级英雄 - 机甲人﹑底片人﹑橡皮少女﹑疯狂简，以及领导他们的怪才「首席」Niles Caulder博士本剧定于美国时间2月15日上线，以下是正式短预告。 　　《末日巡逻队》过去已在《泰坦 Titans》第四集率先出场，这支团队的超级英雄虽然有不同的能力，但同时亦因能力而身心受创，他们在钢骨/Cyborg的号召﹑首席/The Chief的领导下调查奇怪现象并保护地球。 　　Timothy Dalton饰演Niles Caulder博士，被称为「首席/The Chief」的他是位下肢瘫痪的天才，聪明﹑受争议的Niles环游世界找寻需要奇迹才能治好的病患，他会毫不犹豫帮助他们，期间他还组建了英雄团队「末日巡逻队/The Doom Patrol」。（顺带一提，在《泰坦》出场的首席是Bruno Bichir饰演的。） 　　Joivan Wade饰演Victor Stone，亦即是DC著名英雄钢骨/Cyborg，他是个具魅力﹑爱吐糟的半人半机械身英雄，纵使他能控制世界上每一台电脑，但他还是希望能维持与「人类」的联系。 　　Brendan Fraser及Riley Shanahan饰演机甲人/Robotman，身体是生物机械，该角色设定他还是人类Cliff Steele时，因为赛车事故几近死亡，因此他的大脑被转移到机械身上。Brendan Fraser负责机甲人的配音及饰演闪回中的Cliff Steele，而Riley Shanahan则是负责机甲人的表演部份。 　　Matt Bomer及Matthew Zuk饰演底片人/ Negative Man，拥有放射性。Matt Bomer负责配音及饰演底片人闪回中，还是人类时的Larry Trainor，Matthew Zuk则是穿上全身装束负责表演。 　　April Bowlby饰演Rita Farr，亦即橡皮少女/ Elasti Girl，可伸缩肢体﹑Diane Guerrero饰演疯狂简/Crazy Jane，这个英雄可谓不太靠谱，因为她患有世界上最多人格的人格分裂症，不过伴随着这64个人格的是64种超能力，所以疯狂简是末日巡逻队中最强大的战力……但亦是最不稳定的。','subom3u8$$$suboyun$$$wlm3u8$$$wlzy','no$$$no$$$no$$$no','$$$$$$$$$','第01集$https://www.dt870.com/20190220/Bll9zNIf/index.m3u8#第02集$https://www.hongxinhuaxue.com/20190224/m1xnj2aU/index.m3u8#第03集$https://www.dt870.com/20190303/tmvSP5nd/index.m3u8#第04集$https://www.dt870.com/20190310/MD3lQhxq/index.m3u8#第05集$https://www.dt870.com/20190317/DPtQm4N0/index.m3u8#第06集$https://www.dt870.com/20190323/NAM5Sr5W/index.m3u8#第07集$https://www.subo58008.com/20190331/2BvCehTb/index.m3u8#第08集$https://www.subo58008.com/20190406/gHFd0reb/index.m3u8$$$第01集$https://www.dt870.com/share/LD7BNMDKXGusnjtt#第02集$https://www.hongxinhuaxue.com/share/VPB9VG8v6RLFDY7M#第03集$https://www.dt870.com/share/SkIgGJaNYmhJpKfn#第04集$https://