亲——艾迪生，在他的帮助下，从岛上的猴群手中找到了活宝之首。几经周折，众人在药王庄找到了奄奄一息的艾飞将其救活，右活宝也终于被拼接完整。失散千年的左右两个活宝在此重逢，师徒四人见任务圆满完成便启程返回乌龙院。 不料老沙客为提炼活宝原力，将左和右活宝都迷晕抓走。在提炼原力的中途却发生意外，80%活宝原力被其长子沙客季获得。沙客季妄图补全活宝原力，按照祖传秘法抓来极阳之人——乌龙院大师兄，不料活宝原力又意外的转移到了大师兄身上。 乌龙院大师父发现活宝之事并未平息，担心活宝强大的力量落入坏人之手，于是又展开了调查。通过线索众人一直找到庞贵人的密室，发现了沙客家族炼丹宗师沙客一的画像，并被带入一条密道。 原来密道是通往恒王地宫的，在地宫里众人遇到为了获得完整原力而来寻找麒麟胆的大师兄，可当麒麟胆现世时，却吸走了大师兄身上的活宝原力。原来所有一切都是死于千年前的沙客一设的局，他引来活宝原力是为了使自己复活，并妄图统治天下。 众人不敌复活的沙客一，沙客一利用活宝原力和炼丹术，控制着魔仆压榨百姓、炼造了大批如同真人的魔俑，天下江湖危在旦夕。为了阻止他的邪恶阴谋，众人齐聚铁堡，计划派出铁金刚二代和魔军抗衡。大战来临前，铁堡意外失火，铁金刚被烧坏，而此时却传来魔俑大军即将烧制完成的消息。重要关头，大师兄决定带队前往石头城，捣毁魔窑，双方大战将一触即发。</p>','subom3u8$$$suboyun','no$$$no','$$$','第01集$https://www.subo58008.com/20190409/DnmXxUTJ/index.m3u8#第02集$https://www.subo58008.com/20190409/In30xYUL/index.m3u8#第03集$https://www.subo58008.com/20190409/jOGdg6Zh/index.m3u8#第04集$https://www.subo58008.com/20190409/iZjVgQ2N/index.m3u8#第05集$https://www.subo58008.com/20190409/dP2Ootu1/index.m3u8#第06集$https://www.subo58008.com/20190409/PnkioRCZ/index.m3u8#第07集$https://www.subo58008.com/20190409/WxeUX2kM/index.m3u8#第08集$https://www.subo58008.com/20190409/O6Kf5mQE/index.m3u8#第09集$https://www.subo58008.com/20190409/IL0Hb6sD/index.m3u8#第10集$https://www.subo58008.com/20190409/itv1kSdH/index.m3u8#第11集$https://www.subo58008.com/20190409/mVw7M2D9/index.m3u8#第12集$https://www.subo58008.com/20190409/W4BnEpTZ/index.m3u8#第13集$https://www.dt870.com/20190410/Xf52VEAT/index.m3u8#第14集$https://www.subo58008.com/20190409/qZJiso1u/index.m3u8#第15集$https://www.subo58008.com/20190409/rxMaDP1F/index.m3u8#第16集$https://www.subo58008.com/20190409/VmfoxMUr/index.m3u8#第17集$https://www.subo58008.com/20190409/bGF9ymav/index.m3u8#第18集$https://www.subo58008.com/20190409/9AewpFJn/index.m3u8#第19集$https://www.subo58008.com/20190409/ptrYbFoL/index.m3u8#第20集$https://www.subo58008.com/20190409/VKC6ZXsD/index.m3u8#第21集$https://www.subo58008.com/20190409/16aEPClN/index.m3u8#第22集$https://www.subo58008.com/20190409/NXw2DHMW/index.m3u8#第23集$https://www.subo58008.com/20190409/OKV1k5mN/index.m3u8#第24集