。 　　江南义军探知秦桧阴谋，力图营救岳飞，举行武林大会，推举盟主，张君宝适逢其会。义军以武林世家名剑山庄马首是瞻。推举名剑山庄少庄主易继风为盟主。但易继风的武功远逊于早被逐出家门的易天行，易天行无意于武林盟主，却与君宝一见如故，成为至交。突然一妙龄女侠秦思容提出向武林盟主易继风挑战，二人比试之下，易继风竟被思容深深吸引，天行也因为她很像自己以前的恋人而怦然心动。 　　原来秦思容是奸相秦桧的养女，潜入义军行列中，来做卧底，由于秦思容泄漏消息，义军受到伏击，岳飞终在风波亭就义。君宝却在无意之间得到岳飞遗物，奸相秦桧派出杀手追杀君宝，以得到岳飞遗物。 　　君宝的父亲纳妾，君宝去喝喜酒，发现新娘是位十六岁的少女，叫明道红，君宝怕父亲铸成大错，将新娘劫走，送她回家。一路上君宝发现明道红是个遇事求神问卜、难缠的女孩儿，明道红却对君宝产生情愫。 　　君宝的父亲追赶而至，父子争执之际，秦桧爪牙突然出现，围攻张家父子，为救君宝，张父被杀。秦桧爪牙却传言江湖，说君宝是弑父逆子，鼓动武林人士追杀。 　　君宝躲避追杀之时，结识了一个呆头呆脑的和尚澄空大师，澄空将君宝藏在少林寺中，并传授君宝高深武学。易继风被秦桧爪唆使，率众上少林寺寻找君宝，君宝挺身而出，大胜易继风，一战成名。君宝向易继风说出岳飞遗言，如能找到流落北国的大宋公主，作为号召，必能铲除奸相，兴兵北伐。 　　易继风得易天行相助，功力大进，去北方寻找公主，在大漠中巧遇少女赵玉儿，两人产生感情。 　　君宝继续与秦桧爪牙斗争，在拚斗中明道红为救君宝而死，君宝伤心不已。在君宝身边卧底的秦思容，日久生情，爱上君宝，并为自己的所作所为后悔不已。 　　易继风在易天行的帮助下终于找到大宋公主，公主流落民间日久，已成为一泼妇，处处欺负易继风，玉儿一气之下，杀了公主，并与易继风商议冒充大宋公主，领导义军。两人为掩盖这一秘密杀了许多正义之士，而不能自拔，逐渐为秦桧利用。君宝略有觉察。 　　为除掉君宝，秦桧爪牙暗中下毒，君宝丧失记忆，幸得澄空大师相救，君宝不仅复原，且悟出太极神功，武学又上层楼。君宝与易天行联手，战胜秦桧爪牙，秦思容也改邪归正，但她深觉自己所作所为对不起君宝，悄然而去。君宝千山万水寻去，结果发现思容已在峨眉山上出家，日后开创峨嵋一派。 　　君宝回到武当山，改名张三丰，开创武当一派，成为一代宗师。','subom3u8$$$suboyun','no$$$no','$$$','第01集$https://www.subo58008.com/20190409/bugxQyfs/index.m3u8#第02集$https://www.subo58008.com/20190409/KH1R7OkV/index.m3u8#第03集$https://www.subo58008.com/20190409/F8xYWt13/index.m3u8#第04集$https://www.subo58008.com/20190409/pD9AE18i/index.m3u8#第05集$https://www.subo58008.com/20190409/mtj7cdCy/index.m3u8#第06集$https://www.subo58008.com/20190409/uVCn5Wz8/index.m3u8#第07集$https://www.subo58008.com/20190409/oKJwUkzj/index.m3u8#第08集$https://www.subo58008.com/20190409/JCFUn72o/index.m3u8#第09集$https://www.subo58008.com/20190409/8SiLXZOV/index.m3u8#第10集$https://www.subo58008.com/20190409/HTXf9SCs/index.m3u8#第11集$https://www.subo58008.com/20190409/7uXLeyVf/index.m3u8#第12集$https://www.subo58008.com/20190409/4VkLeDAE/index.m3u8#第13集$https://www.subo58008.com/20190409/qbSTdnRL/index.m3u8#第14集$https://www.subo58008.com/20190409/JE2oPqkr/index.m3u8#第15集$https://www.subo58008.com/20190409/vL4GoYfm/index.m3u8#第16集$https://www.subo58008.com/20190409/9lgHQEVS/index.m3u8#第17集$https://www.subo