会经过佛格家门前，佛格坐在那破旧的家门口，就像漫画中的卜派一样是个小人物，但是并没有神气活现的样子，“我不知道他知不知道他就是卜派！”舒赫特说，佛格常常到拳击场打拳，不常输。 至于奥莉薇形象的巴斯科尔，经营一家杂货店，孩子们常常在店门外望着她修长的身影，但是很少人敢走进去，她也不常步出店门外，舒赫特说“我们有点怕她。”舒赫特的曾叔父威廉-舒赫特是切斯特一家剧院的老板，他在漫画中也有一角，是爱吃汉堡的Wimpy。真实的老舒赫特也爱吃汉堡，当时雇用卜派漫画的作者西格负责舞台灯光，这份工作的收入让西格能够付钱学画画。 西格在1920年代初期搬离切斯特后，便很少回到这个小镇。','subom3u8$$$suboyun','no$$$no','$$$','第01集$https://www.subo58008.com/20190410/cMXd3KsD/index.m3u8#第02集$https://www.subo58008.com/20190410/oa2HyGE5/index.m3u8#第03集$https://www.subo58008.com/20190410/B9Kynrig/index.m3u8#第04集$https://www.subo58008.com/20190410/0SoP7ezZ/index.m3u8#第05集$https://www.subo58008.com/20190410/YGHwOdcg/index.m3u8#第06集$https://www.subo58008.com/20190410/a1qXgfF9/index.m3u8#第07集$https://www.subo58008.com/20190410/D4Rfm1Qa/index.m3u8#第08集$https://www.subo58008.com/20190410/1uE5O3Vv/index.m3u8#第09集$https://www.subo58008.com/20190410/kydxjTPg/index.m3u8#第10集$https://www.subo58008.com/20190410/apARPFo0/index.m3u8#第11集$https://www.subo58008.com/20190410/YUmld1QB/index.m3u8#第12集$https://www.subo58008.com/20190410/v5qw0oLr/index.m3u8#第13集$https://www.subo58008.com/20190410/fV7U4XOc/index.m3u8#第14集$https://www.subo58008.com/20190410/p9Nj8us5/index.m3u8#第15集$https://www.subo58008.com/20190410/lIomAgxB/index.m3u8#第16集$https://www.subo58008.com/20190410/aD3RHZVx/index.m3u8$$$第01集$https://www.subo58008.com/share/NcozCZrguXaQdVlx#第02集$https://www.subo58008.com/share/SIvVQrC5Hhqp0Ukw#第03集$https://www.subo58008.com/share/aj9JZ4qQmDBLYUlV#第04集$https://www.subo58008.com/share/F8WVQlte1GySjYMT#第05集$https://www.subo58008.com/share/skmdPHnjceR8u06y#第06集$https://www.subo58008.com/share/SMqUBx8NCDnrG9hc#第07集$https://www.subo58008.com/share/p5OKtrNUSLB2DVT0#第08集$https://www.subo58008.com/share/XbMPUoOCYduLEyQn#第09集$https://www.subo58008.com/share/h05rfyAxujQk4YPw#第10集$https://www.subo58008.com/share/qiuxteHP5TEZSh1J#第11集$https://www.subo58008.com/share/jAJK0TInfCU1yYrz#第12集$https://www.subo58008.com/share/tLdB2l0KbzhnqJam#第13集$https://www.subo58008.com/share/VEnlcaAdGJZKCtbQ#第14集$http