年。一次他们到了一个村口贴着禁止乞丐入内的布告牌的村子，千代吉苦苦哀求允许入村，巡警不仅不肯，还把他猛地一下推开。到了昭和十八年八月，当地派出所不断接到地里东西被窃的报告，警官三木谦一根据报告的线索找到了这父子乞丐。好心的他不仅没有把他们赶走，还把千代吉妥善安排到国立疗养院，又把本浦秀夫领作了自己的养子。 \n　　但不知什么原因，昭和十九年底，秀夫又到大阪当了和贺自行车铺的小伙计，从而伪造户籍，后来，他经过发愤苦学，读了高中，又去东京读了艺术大学，从而青云直上，变成了和贺英良…… \n　　案发前，三木谦一正在为重新找到自己的养子而兴奋不已，他想找到和贺英良，让他去国立疗养院见自己的亲生父亲，可和贺英良却因为怕暴露了和麻风病父亲的关系会毁掉他的名誉和前程，于是残忍地杀死了养父三木。','wlm3u8$$$wlzy','no$$$no','$$$','HD高清$http://cn2.zhongshanchemical.com/hls/20190405/c0439e87572f4fe372333f532e9303e5/1554432476/index.m3u8$$$HD高清$http://qiaozhen.com.cn/share/MTMzMDQ1JEhE6auY5riF','','','',''),(1370,13,2,0,'花漾天海第一季','','huayangtianhaidiyiji',1,'H','','爱情,大卫,船长','国产','upload/vod/20190411-1/9577577b3fb98f2fcaf3f2f96c3f4610.jpg','','','秦语,白翔,王艺明,王今铎','马克','','','                                　　本片以邮轮生活为创作源泉，讲述了天海号这艘邮轮上发生的故事，从船长大卫、酒店总监裴冷翠、娱乐部经理、米其林三星主厨、宾客关系部新人等','完结','',0,'0','','','中国大陆','普通话','2018','','','','','','','',1,0,0,0,0,0,0,108,885,744,849,'',324,199,4.0,3588,897,1554946548,1554946548,0,0,0,0,0.0,'','','','','','','','','','                                　　本片以邮轮生活为创作源泉，讲述了天海号这艘邮轮上发生的故事，从船长大卫、酒店总监裴冷翠、娱乐部经理、米其林三星主厨、宾客关系部新人等八名性格各异的工作人员主视角出发，每集以不同的游客作为故事主导人物，讲述爱情、友情以及亲情等不同主题的故事\n                        ','wlm3u8$$$wlzy','no$$$no','$$$','第1集$http://cn2.zhongshanchemical.com/hls/20190405/1358dbbd7694db64faf09b8f0f596ee7/1554439430/index.m3u8#第2集$http://cn2.zhongshanchemical.com/hls/20190405/66a1708301ca8320568e88218bb70a06/1554440206/index.m3u8#第3集$http://cn2.zhongshanchemical.com/hls/20190405/0f530ca5f51397587bc5921313bf23e3/1554437457/index.m3u8#第4集$http://cn2.zhongshanchemical.com/hls/20190405/2221809697a4e3ed07b31206afebed62/1554437730/index.m3u8#第5集$http://cn2.zhongshanchemical.com/hls/20190405/2ccbdd602ea6f3f6dd8325543b9181dd/1554438026/index.m3u8#第6集$http://cn2.zhongshanchemical.com/hls/20190405/dce06ef5a0842a689fde5c1e3308527b/1554438307/index.m3u8#第7集$http://cn2.zhongshanchemical.com/hls/20190405/e36943e1899773328e29370481151b04/1554438610/index.m3u8#第8集$http://cn2.zhongshanchemical.com/hls/201904