，保护他们中的一位重要同志去上海，这位重要同志是谁，他们全不知晓。好家伙们上路了，这一路只能靠他们自己的力量来保证安全。每一个人都要想尽办法来保护身边的同志；每一个人又都是他们群体中的被掩护者。他们都力求在生命耗尽前让拦截者偏离目标；每一个好家伙都会笑到了最后，因为每一个人都相信自己的秘密是假的；而每一个人都相信自己的牺牲能让被掩护的同志到达目的地。 \n　　以四海为首的土匪，以国民党反动派陈殊图为首的顽固分子，还有汉奸芦之苇和日本鬼子等等坏家伙们给好家伙们带来层层阻拦。他们率领着各自的队伍，在天外山匪帮拦截，在黄沙会拦截，在国统区拦截，在日占区拦截，在船帮拦截，在天目山拦截…… \n　　从西北烈日黄沙，到上海冰样奢华——首先遇到的是土匪与陈殊图勾结的队伍，第一个好家伙崔百岁为引开敌人而主动出击，牺牲在自己的新婚之日。接着，其他的好家伙有冒充土匪的，有装着回西安老家的，也有明火执仗杀开血路的，拼死掩护自认为是重要同志的安全。从万里狂沙到江南水乡——诸葛骡子在刑台上为自己早死的孩子哼着催眠曲；肉票古骨碌为了掩护绑匪七叶而死；绑匪七叶为掩护肉票古骨碌而死；与大队失去联系多年的门栓为狙击敌人而数天数夜假死；身陷囹圄的芦淼在牢狱中把审讯者从头误导到尾，直至活着被钉棺，再连棺活埋。一路上与各色敌人的生死战斗，好家伙们只为保护他们自己认为最重要的同志早日安全到达目的地。而好家伙们的领袖，知人至极的青山，所有迹象都表明他是唯一被护送的重要同志，但是青山却在与四海的对垒时，把“我们本可以用日本人的血抹红天空，我们却在用同胞的血涂染大地”这样的怀疑之火植入四海心中后，亦殇于四海枪下。 \n　　青山死后，似乎好家伙们的护送任务失败了。对于四海、陈殊图和芦之苇等人如此，对到达上海的芦焱等好家伙们也如此。而芦焱突然发现青山最大的贡献在于：他把那份真正的任务塞进了芦焱脑子里，因为芦焱外行到各路人马都当他是炮灰，也因为芦焱的身世——芦之苇是他的父亲。 \n　　陈殊图被日军和汉奸芦之苇设局俘虏了，芦焱与幸存的好家伙们加入对殊图的营救——日军的阴谋是欲伙同芦之苇汉奸们根灭抗日力量，为日军最后的挣扎留下时间和空间；芦之苇却是想扩大自己的势力范围。因为陈殊图虽然反共但亦强烈抗日，所以好家伙们本着抗日统一战线原则营救了他。被救的陈殊图看着垂死的门栓，门栓问“你会去杀日寇吧？”——好家伙们最后的牺牲是他们的最后计划，因为他们埋下了的希望的种子。这个希望就是唤醒大家团结起来一致抗日。 \n　　陈殊图报答芦焱的救命之恩，暂时停止了国民党反共的摩擦；在好家伙们的帮助下杀了汉奸芦之苇；然而在其内心深处依然在等待时机来反共。一旦时机成熟，实力和势力大大加强和稳定后，陈殊图就会开始对芦焱等人进行破坏和打击。 \n　　芦焱大义灭亲，根除汉奸芦之苇。四海在芦焱等好家伙们的行为感召下，识破了国民党顽固派的阴险小气，带队回归到民族抗日的阵营中。四海搭救了被追杀的芦焱，两人联合起来消灭了日本军的进攻。在抗战胜利之时，四海对芦焱说“我相信你说的国家美好未来会到来，那时我就可以在光天化日下生活。我相信我们能一直等到你说的那天到来”。','wlm3u8$$$wlzy','no$$$no','$$$','第1集$http://cn2.zhongshanchemical.com/hls/20190406/2014ec0901058ff719b3a5ee5ebdbea6/1554519910/index.m3u8#第2集$http://cn2.zhongshanchemical.com/hls/20190406/52c4f68ffa62945c7e4eaf7165f4395d/1554522801/index.m3u8#第3集$http://cn2.zhongshanchemical.com/hls/20190406/38b33f9f73afd2bdf6b08317f0400ac8/1554524960/index.m3u8#第4集$http://cn2.zhongshanchemical.com/hls/20190406/2ea6ddf3bb88448512593d76ddd1587b/1554525245/index.m3u8#第5集$http://cn2.zhongshanchemical.com/hls/20190406/1f72857569ca6eb6fb8d620fb21a1008/1554525519/index.m3u8#第6集$http://cn2.zhongshanchemical.com/hls/20190406/21a14555bb9e778b119459d740a2023c/1554525756/index.m3u8#第7集$http://cn2.zhongshanchem